import React, { useState } from 'react';


function PainelAluno(){
    const [aluno, setAluno] = useState("samuel")

    return(
        <div>
            <nav className="navAluno">
                <img></img>
                <p>Ola aluno {aluno}</p>
            </nav>
        </div>
    )
}

export default PainelAluno
